<!--
  Calculations for Total and NR:

  The 660 MB size for Dist7 uses 8 of 11 ET bits so use 189322 from
  totals.html for the number of symmetry reduced combinations of edge
  position and edge twist.

  Combine that with the 6-color component (EPR) for the total.
  189322 * 13824 = 2617187328

  Sum counts for depths 0-10: 1486216433

  Subtract that from total for NR:
  2617187328 - 1486216433 = 1130970895
-->
